const Index = () => (
    <Layout>
        <CompressContainer>
            {/*<TitleWrapper>NEVER SETTLE</TitleWrapper>*/}
            <Whoami/>
            <SkillSet/>
            <TaskList listHeader="history" taskList={historyList} />
            <ContactMe />
        </CompressContainer>
        <TitleWrapper>NEVER SETTLE</TitleWrapper>
    </Layout>
);
export default Index;
